import React from 'react';
import './BuildControl.css';

const buildControl = (props) => {
	const {type} = props;
	return <div className="room-data">
			<div className="adult-count">
				<div className="">
					<p>Adults</p>
					<p>(18+)</p>
				</div>
				<select onChange = {() => props.updatePersonHandler(event,type,"adultCount")} >
					{[1,2].map(v => <option key = {"adult"+v}  value = {v} >{v}</option>)}
				</select>
			</div> 
			<div className="children-count">
				<div className="">
					<p>Children</p>
					<p>(0-17)</p>
				</div>
				<select onChange = {() => props.updatePersonHandler(event,type,"childrenCount")}>
				{[0,1,2].map(v => <option key = {"children"+v} value = {v} >{v}</option>)}
				</select>
			</div>
		</div>
}

export default buildControl;
